(37, 'viagem', '2015-05-20 08:00:00', '2015-05-20 18:00:00', 'Smart Challenge', 'O SmartChallenge proporciona um contato direto e prático com situações que possivelmente farão parte da vida profissional do engenheiro, através de planejamento, montagem e programação\nde um sistema robótico simples a fim de cumprir determinado objetivo. Os participantes do desafio desenvolvem habilidades como a cooperação, a capacidade de solucionar problemas e o espírito de liderança.', '{\"location\":\"\",\"desc\":\"Desafio surpresa em grupo para aplicar conhecimentos de engenharia\",\"palestrantes\":\"\",\"pic\":\"\\/images\\/icons\\/smart.png\",\"vagas\":\"20\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"Recomenda-se trazer notebook para realizar a programa\\u00e7\\u00e3o dos microcontroladores.\"}}', 11, ''),
(38, 'viagem', '2015-05-20 14:00:00', '2015-05-20 16:00:00', 'ZF', 'A planta da ZF Araraquara tem como principal produto a linha de embreagens para veículos de linha leve. Com várias células autônomas de produção, a planta e seus trabalhadores tem muito o que mostrar aos participantes da visita. ', '{\"location\":\"\",\"desc\":\"A planta da ZF Araraquara tem como principal produto a linha de embreagens para ve\\u00edculos de linha leve. Com v\\u00e1rias c\\u00e9lulas aut\\u00f4nomas de produ\\u00e7\\u00e3o, a planta e seus trabalhadores tem muito o que mostrar aos participantes da visita. \",\"palestrantes\":\"\",\"pic\":\"\\/images\\/icons\\/zf.png\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 11, ''),
(39, 'viagem', '2015-05-20 14:00:00', '2015-05-20 16:30:00', '3M', 'A 3M destaca-se no Brasil e no mundo como a empresa líder de inovação e investimento nos mais variados setores de produção. A fábrica de Ribeirão Preto foi a segunda a ser instalada no Brasil e se destaca pela produção de componentes elétricos, materiais de comunicação gráfica e adesivos automotivos. Venha conhecer o processo produtivo e a ciência por traz de uma das empresas que mais investe em novas tecnologias.', '{\"location\":\"Ponto de \\u00d4nibus da Arquitetura\",\"desc\":\"A f\\u00e1brica de Ribeir\\u00e3o Preto foi a segunda a ser instalada no Brasil e se destaca pela produ\\u00e7\\u00e3o de componentes el\\u00e9tricos, materiais de comunica\\u00e7\\u00e3o gr\\u00e1fica e adesivos automotivos. Venha conhecer o processo produtivo e a ci\\u00eancia por traz de uma das empresas que mais investe em novas tecnologias.\",\"palestrantes\":\"\",\"pic\":\"\\/images\\/icons\\/3m.png\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 11, ''),
(41, 'minicurso', '2015-05-21 08:00:00', '2015-05-21 18:00:00', 'Matlab', 'O Mini-Curso Introdutório MATLAB e Simulink consiste em conceitos básicos para manuseio e conhecimento das funcionalidades iniciais do software, capacitando os alunos para a utilização das principais funções do produto.', '{\"location\":\"O Mini-Curso Introdut\\u00f3rio MATLAB e Simulink consiste em conceitos b\\u00e1sicos para manuseio e conhecimento das funcionalidades iniciais do software, capacitando os alunos para a utiliza\\u00e7\\u00e3o das principais fun\\u00e7\\u00f5es do produto.\",\"desc\":\"O Mini-Curso Introdut\\u00f3rio MATLAB e Simulink consiste em conceitos b\\u00e1sicos para manuseio e conhecimento das funcionalidades iniciais do software, capacitando os alunos para a utiliza\\u00e7\\u00e3o das principais fun\\u00e7\\u00f5es do produto.\",\"palestrantes\":\"\",\"pic\":\"\\/images\\/icons\\/matlab.png\",\"vagas\":\"20\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 11, ''),
(42, 'minicurso', '2015-05-21 09:00:00', '2015-05-21 12:00:00', 'Miura', 'Parte 1: Finanças Pessoais\n- O que é, importância e como fazer.\n- Velho investidor x novo investidor\n- Ciclo de Investimentos\n- Produtos financeiros no Brasil\n\nParte 2 \n- Perfis de investidores\n- Explicação conceitual dos produtos financeiros em cada tipo de perfil\n\nParte 3: Entendendo a renda variável no Brasil\n\nParte 4: Check -up financeiro\n- Importância do Asset Allocation\n', '{\"location\":\"\",\"desc\":\"No\\u00e7\\u00f5es do mercado financeiro brasileiro e dicas de como administrar as mais variadas formas de investimentos.\",\"palestrantes\":\"\",\"pic\":\"\\/images\\/icons\\/miura.png\",\"vagas\":\"25\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 11, ''),
(43, 'palestra', '2015-05-18 14:00:15', '2015-05-18 15:15:27', 'Matemática e Física na Engenharia', '&quot;Na XI SEMATRON, uma das palestras será ministrada pelo Coronel da reserva e Ph.D. Nehemias Lacerda, com o tema &quot;&quot;Matemática e Física na Engenharia e na Natureza&quot;&quot;.\nSerão abordados assuntos como: o início da carreira como consultor físico, uso de tecnologias avançadas para resolver problemas diários, imitação da natureza como inovação tecnológica e a equivalência da busca de resultados em consultoria com investigações policiais.\nPara maiores informações, confira a reportagem da Folha de S. Paulo sobre a sua carreira: http://bit.ly/10tEPLK&quot;', '{\"location\":\"Anfiteatro Jorge Caron\",\"desc\":\"\",\"palestrantes\":\"Nehemias Lacerda\",\"pic\":\"\",\"vagas\":\"\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 11, ''),
(44, 'palestra', '2015-05-21 19:00:26', '2015-05-21 20:30:33', 'Intelligent Robots for Environment Monitoring', 'Understanding and predicting environmental phenomena such as air pollution or aquatic weed outbreaks involves modelling complex spatial-temporal relationships. Robots can be an essential tool for this task as a single robot can carry expensive sensors and monitor large areas of the environment. Current approaches to robotic monitoring and exploration such as information gain make a strong assumption that all parts of the environment are equally important, and the goal is to minimise the overall predictive uncertainty. However, in many problems such as air pollution monitoring or terrain reconstruction, areas with high levels of pollution or more complicated terrain shapes require denser sampling. In this talk I will present a novel technique for learning spatial-temporal environment processes where the amount of sampling depends on the complexity and/or magnitude of the function being learnt. The method is based on Bayesian optimisation and is able to select paths that maximise the prediction performance for processes where tracking peaks is crucial (such as air pollution), trading exploration-exploitation in a principled statistical manner. I will show applications in air pollution monitoring, vibration modelling while navigating on uneven terrains, and lightening changes to illustrate the benefits of the approach. Finally I will show a commercial application of the technique where a web-based app was built for the Environmental Protection Agency in Australia, for real-time air pollution forecast in the Hunter Valley region, where coal mines, urban centres and vineyards need to coexist.', '{\"location\":\"Anfiteatro Jorge Caron\",\"desc\":\"\",\"palestrantes\":\"F\\u00e1bio Ramos\",\"pic\":\"\",\"vagas\":\"\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 11, ''),
(45, 'palestra', '2015-05-22 09:00:42', '2015-05-22 10:15:43', 'Poço inteligente: tomografia elétrica inovadora de poços de petróleo utilizando sensor de malha de fios de resposta rápida.', 'A ocorrência frequente na indústria de escoamentos multifásicos em tubulações tem motivado um grande interesse no tema nas últimas décadas. No caso particular da indústria do petróleo, se verificam escoamentos de misturas de óleo, água e gás, tanto na produção, quanto no transporte dos hidrocarbonetos. Apesar disso, os escoamentos trifásicos têm sido pouco estudados; ainda não existe uma compreensão razoável de um número significativo de fenômenos observados nesses escoamentos, como, por exemplo, a relação entre a topologia interfacial e a perda de carga. O sensor wire-mesh, um método híbrido baseado na medição de resistência ou capacitância, que combina medição local intrusiva da fração de fase e imagens tomográficas transversais, oferece uma boa resolução espacial e alta resolução temporal em comparação com outras técnicas atuais. Nesta apresentação, veremos o desenvolvimento de um tomógrafo inovador baseado na tecnologia wire-mesh para o estudo de escoamentos trifásicos, onde ocorre a presença de óleo viscoso, água e ar. Pela primeira vez, serão apresentadas imagens tomográficas de escoamento trifásico obtidas em tempo real e a altas frequências de aquisição. O principal objetivo prático é a validação de uma ferramenta de referência para o desenvolvimento de instrumentação para aplicações em campos petrolíferos, o que se insere no contexto do “poço inteligente”', '{\"location\":\"Anfiteatro Jorge Caron\",\"desc\":\"\",\"palestrantes\":\"Oscar Rodriguez \",\"pic\":\"\",\"vagas\":\"\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 11, ''),
(46, 'palestra', '2015-05-19 10:45:40', '2015-05-19 12:00:09', 'WITRA: Tecnologia Wearable para Interação com Robôs', 'WITRA, acrônimo para Wearable Interface for Teleoperation of Robotic Arms, é uma solução inovadora e intuitiva na interação homem-robô. A partir da captura dos movimentos do braço do usuário por meio de sensores, é possível controlar os movimentos de um manipulador robótico à distância.', '{\"location\":\"Anfiteatro Jorge Caron\",\"desc\":\"\",\"palestrantes\":\"Vin\\u00edcius Bazan\",\"pic\":\"\",\"vagas\":\"\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 11, ''),
