(51, 'minicurso', '2016-05-12 08:00:00', '2016-05-12 12:00:00', 'VHDL e FPGA', 'Um FPGA é um circuito integrado projetado para ser configurado por um consumidor ou projetista após a fabricação – de onde advém &amp;amp;amp;amp;quot;programável em campo&amp;amp;amp;amp;quot;.', '{\"location\":\"Laborat\\u00f3rio LED\",\"desc\":\"FPGA \\u00e9 um circuito integrado projetado para ser configurado por um consumidor ou projetista ap\\u00f3s a fabrica\\u00e7\\u00e3o \\u2013 de onde adv\\u00e9m \\\"program\\u00e1vel em campo\\\". Nas tr\\u00eas horas iniciais haver\\u00e1 um apanhado de princ\\u00edpios b\\u00e1sicos de VHDL e FPGA e na \\u00faltima hora, um hands-on.\",\"palestrantes\":\"\",\"pic\":\"http:\\/\\/i.imgur.com\\/axuhq53.png\",\"vagas\":\"0\",\"m\":{\"ch\":\"4\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 12, ''),
(52, 'minicurso', '2016-05-12 08:00:00', '2016-05-12 18:00:00', 'Microcontroladores', 'O minicurso tem o objetivo de apresentar os microcontroladores e de ensinar aos participantes como fazer uso dos mesmos.\nUm microcontrolador é um computador-num-chip, contendo um processador, memória e periféricos de entrada/saída. É um microprocessador que pode ser programado para funções específicas, em contraste com outros microprocessadores de propósito geral.', '{\"location\":\"Sala Lei Menor\",\"desc\":\"O minicurso tem o objetivo de apresentar os microcontroladores e de ensinar aos participantes como fazer uso dos mesmos.  Microcontroladores PIC \\u2013 Fam\\u00edlia 18F \\u2013 Programa\\u00e7\\u00e3o em C\",\"palestrantes\":\"Prof. Dr. Marcelo Vieira\",\"pic\":\"\\/images\\/icons\\/pic.png\",\"vagas\":\"0\",\"m\":{\"ch\":\"8h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 12, ''),
(53, 'minicurso', '2016-05-12 08:00:00', '2016-05-12 12:00:00', 'LittleBits: Prototipando Inovação', 'Nesse minicurso, usaremos os módulos eletrônicos LittleBits para prototipar soluções de tecnologia com materiais simples, mas com um olhar profundo em como propor algo realmente inovador. Do brainstorming à prototipagem, vamos entender os processos de inovação que são usados para criar tecnologias que mudam nossa forma de pensar e nos relacionar com o mundo.', '{\"location\":\"ICMC Lab 6.303\",\"desc\":\"Nesse minicurso, usaremos os m\\u00f3dulos eletr\\u00f4nicos LittleBits para prototipar solu\\u00e7\\u00f5es de tecnologia com materiais simples, mas com um olhar profundo em como propor algo realmente inovador.\",\"palestrantes\":\"\",\"pic\":\"http:\\/\\/i.imgur.com\\/c8YTg7g.png\",\"vagas\":\"0\",\"m\":{\"ch\":\"4h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 12, ''),
(54, 'minicurso', '2016-05-12 08:00:00', '2016-05-12 18:00:00', 'Arduino', 'Como sentir o ambiente, pensar numa resposta e atuar nele? Nesse minicurso, o participante terá a oportunidade de aprender como usar essa poderosa ferramenta em uma série de atividades práticas.', '{\"location\":\"Laborat\\u00f3rio de Micros da Mecatr\\u00f4nica\",\"desc\":\"Como sentir o ambiente, pensar numa resposta e atuar nele? Nesse minicurso, o participante ter\\u00e1 a oportunidade de aprender como usar essa poderosa ferramenta em uma s\\u00e9rie de atividades pr\\u00e1ticas.\",\"palestrantes\":\"\",\"pic\":\"\\/images\\/icons\\/arduino.jpg\",\"vagas\":\"0\",\"m\":{\"ch\":\"8h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 12, ''),
(55, 'minicurso', '2016-05-12 08:00:00', '2016-05-12 18:00:00', 'ADAMS', 'ADAMS é o software de dinâmica de vários corpos mais usado mundialmente, e ajuda o engenheiro a estudar como o movimento, carregamento e forças estão distribuídos através de um sistema mecânico. O objetivo desse minicurso é apresentar os básicos da ferramenta aos participantes, mostrando como utilizá-la e também sua importância na engenharia moderna.', '{\"location\":\"Sala de Treinamento da Biblioteca da EESC\",\"desc\":\"ADAMS \\u00e9 o software de din\\u00e2mica de v\\u00e1rios corpos mais usado mundialmente, e ajuda o engenheiro a estudar como o movimento, carregamento e for\\u00e7as est\\u00e3o distribu\\u00eddos atrav\\u00e9s de um sistema mec\\u00e2nico. O objetivo desse minicurso \\u00e9 apresentar os b\\u00e1sicos da ferramenta aos participantes, mostrando como utiliz\\u00e1-la e tamb\\u00e9m sua import\\u00e2ncia na engenharia moderna.\",\"palestrantes\":\"\",\"pic\":\"\\/images\\/icons\\/adams.png\",\"vagas\":\"0\",\"m\":{\"ch\":\"8h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 12, ''),
(56, 'minicurso', '2016-05-12 08:00:00', '2016-05-12 18:00:00', 'KUKA', 'O participante conhecerá através deste minicurso as atitudes de segurança necessárias para manipulação do robô, além da programação básica do mesmo: programação &amp;amp;amp;amp;quot;ponto-a-ponto&amp;amp;amp;amp;quot;. O próprio participante poderá interagir com o manipulador e fundamentar seus conhecimentos, conhecendo assim a potencial dos robôs manipuladores. Uma breve fundamentação teórica sobre manipuladores será realizada no início e será apresentado também, ao final, noções sobre controle de força.\n', '{\"location\":\"Sala do KUKA, segundo andar da Mecatr\\u00f4nica\",\"desc\":\"O participante conhecer\\u00e1 atrav\\u00e9s deste minicurso as atitudes de seguran\\u00e7a necess\\u00e1rias para manipula\\u00e7\\u00e3o do rob\\u00f4, al\\u00e9m da programa\\u00e7\\u00e3o b\\u00e1sica do mesmo, e poder\\u00e1 interagir com o manipulador e fundamentar seus conhecimentos.\",\"palestrantes\":\"\",\"pic\":\"\\/images\\/icons\\/kuka.png\",\"vagas\":\"0\",\"m\":{\"ch\":\"8h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 12, ''),
(57, 'minicurso', '2016-05-12 08:00:00', '2016-05-12 18:00:00', 'Unity', 'Desenvolva o jogo dos seus sonhos com o Unity! Este minicurso dará uma breve introdução a uma das ferramentas mais populares para o desenvolvimento de jogos atualmente, explicando um pouco sobre os passos necessários para a criação de um game, desde sua concepção até sua publicação.', '{\"location\":\"Estruturas\",\"desc\":\"Desenvolva o jogo dos seus sonhos com o Unity! Este minicurso dar\\u00e1 uma breve introdu\\u00e7\\u00e3o a uma das ferramentas mais populares para o desenvolvimento de jogos atualmente, explicando um pouco sobre os passos necess\\u00e1rios para a cria\\u00e7\\u00e3o de um game, desde sua concep\\u00e7\\u00e3o at\\u00e9 sua publica\\u00e7\\u00e3o.\",\"palestrantes\":\"\",\"pic\":\"\\/images\\/icons\\/unity.png\",\"vagas\":\"0\",\"m\":{\"ch\":\"8h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 12, ''),
(58, 'minicurso', '2016-05-12 08:00:00', '2016-05-12 12:00:00', 'Cabeça de Investidor', 'Investimentos. Isso te lembra bolsa de valores? Gráficos? Pessoas gritando em frente a uma tela?\nNão se engane, investir é mais que isso e você pode começar isso agora.\nO Cabeça de Investidor pode te ajudar a começar a dar os primeiros passos, de forma prática e direta. Entenda porque o Tesouro direto é a sua alternativa para a poupança e como comeaçar a investir sem grandes estresses. ', '{\"location\":\"Mecatr\\u00f4nica 2\",\"desc\":\"O Cabe\\u00e7a de Investidor pode te ajudar a come\\u00e7ar a dar os primeiros passos, de forma pr\\u00e1tica e direta. Entenda porque o Tesouro direto \\u00e9 a sua alternativa para a poupan\\u00e7a e como comea\\u00e7ar a investir sem grandes estresses.\",\"palestrantes\":\"\",\"pic\":\"http:\\/\\/i.imgur.com\\/NZTvRwE.png\",\"vagas\":\"0\",\"m\":{\"ch\":\"4h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 12, ''),
(59, 'minicurso', '2016-05-12 08:00:00', '2016-05-12 12:00:00', 'ANSYS', '- Comandos Básicos: definição de tipo de análise; definição de tipo de elemento; propriedades do material; criação da malha; imposição de carregamentos; visualização dos resultados.\n\n- Análise Estática: análise de estrutura sob carragamento estático; avaliação das tensões internas; avaliação das deformações.\n\n- Análise Modal: cálculo de frequências naturais; cálculo de modos de vibrar.\n\n- Análise Transiente: cálculo de tensões internas e esforços durante carregamento dinâmico; visualização das deformações.\n\n- Análise de Resposta em Frequência: cálculo das funções de resposta em frequência da estrutura.', '{\"location\":\"STI Sala 2\",\"desc\":\"O ANSYS \\u00e9 um software de simula\\u00e7\\u00e3o em elementos finitos. O participante ver\\u00e1 os seguintes t\\u00f3picos: Comandos B\\u00e1sicos, An\\u00e1lise Est\\u00e1tica, An\\u00e1lise Modal, An\\u00e1lise Transiente, An\\u00e1lise de Resposta em Frequ\\u00eancia\",\"palestrantes\":\"\",\"pic\":\"http:\\/\\/i.imgur.com\\/L6uv6k1.png\",\"vagas\":\"0\",\"m\":{\"ch\":\"4h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 12, ''),
(60, 'viagem', '2016-05-11 11:30:00', '2016-05-11 18:30:00', 'AFA', 'Durante a visita o grupo assistirá a uma explanação sobre a formação dos futuros líderes da Força Aérea Brasileira e a estrutura empregada no treinamento. Em seguida, visitaremos algumas instalações da Academia.', '{\"location\":\"Pirassununga\",\"desc\":\"Durante a visita o grupo assistir\\u00e1 a uma explana\\u00e7\\u00e3o sobre a forma\\u00e7\\u00e3o dos futuros l\\u00edderes da For\\u00e7a A\\u00e9rea Brasileira e a estrutura empregada no treinamento. Em seguida, visitaremos algumas instala\\u00e7\\u00f5es da Academia. Apenas para brasileiros!\",\"palestrantes\":\"\",\"pic\":\"\\/images\\/icons\\/afa.png\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"Apenas brasileiros!\\nEvitar roupas curtas ou decotadas.\\nTodos devem estar de cal\\u00e7a.\\nAconselhav\\u00e9l levar uma garrafa individual de \\u00e0gua.\"}}', 12, ''),
(61, 'viagem', '2016-05-11 11:00:00', '2016-05-11 18:30:00', 'John Deere', '', '{\"location\":\"Campinas\",\"desc\":\"Visita ao centro de distribui\\u00e7\\u00e3o de pe\\u00e7as\",\"palestrantes\":\"\",\"pic\":\"http:\\/\\/i.imgur.com\\/AmUrNjL.png\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 12, ''),
(62, 'viagem', '2016-05-11 08:00:00', '2016-05-11 12:30:00', 'TAM', 'A TAM MRO, unidade de negócio voltada às atividades de manutenção, reparo e revisão de aeronaves e componentes aeronáuticos, está comprometida com a segurança do trabalho, saúde, proteção ao meio ambiente, qualificação e valorização de seus profissionais.\nA Liderança da TAM MRO e seus profissionais, próprios e subcontratados, estão comprometidos e são incentivados a:\n• Atender às necessidades e expectativas de nossos clientes;\n• Atuar com ética e de acordo com as leis, normas, regulamentos internos e externos e outros requisitos aplicáveis às operações e aos aspectos ambientais;\n• Utilizar, de forma sustentável, eficiente e com segurança, as tecnologias e boas-práticas aplicadas nas operações, ampliando o nosso compromisso de sermos uma empresa responsável com o meio ambiente, com a vida e a segurança de todas as partes afetadas pelas nossas operações;\n• Assegurar a melhoria contínua dos nossos processos, treinamento e ações educacionais de modo a reforçar a prevenção da poluição com enfoque principal no gerenciamento de resíduos, efluentes líquidos e recursos naturais e a prevenção de acidentes do trabalho em nossas operações;\n• Assegurar que todos os acidentes e incidentes ambientais e do trabalho serão relatados e investigados;\nTodos os profissionais devem ter uma atitude facilitadora para com as partes interessadas quanto à divulgação das questões de saúde, segurança do trabalho e meio ambiente, atuando de forma preventiva, gerenciando os riscos e reduzindo ou eliminando as causas e os impactos dos desvios, e exercendo uma liderança responsável.', '{\"location\":\"S\\u00e3o Carlos\",\"desc\":\"Visita a TAM MRO, unidade de neg\\u00f3cio voltada \\u00e0s atividades de manuten\\u00e7\\u00e3o, reparo e revis\\u00e3o de aeronaves e componentes aeron\\u00e1uticos. O museu estar\\u00e1 fechado.\",\"palestrantes\":\"\",\"pic\":\"\\/images\\/icons\\/tam.png\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"* Fotos n\\u00e3o est\\u00e3o autorizadas.\\n* N\\u00e3o \\u00e9 permitido c\\u00f3pia de documento interno.\\n* N\\u00e3o \\u00e9 permitido uso de bolsas e equipamentos eletr\\u00f4nicos (celulares, tablets, computadores, dentre outros). \\n* Os visitantes dever\\u00e3o vestir-se com cal\\u00e7a e sapato fechado. N\\u00e3o \\u00e9 permitido uso de camiseta regata.\\n* Os visitantes dever\\u00e3o portar documento de identifica\\u00e7\\u00e3o.\"}}', 12, ''),
(63, 'viagem', '2016-05-11 10:30:00', '2016-05-11 19:30:00', 'Mahle', '', '{\"location\":\"Jundia\\u00ed\",\"desc\":\"Welcome Coffee 14h00 - Institucional 14h30 - Site Tour 15h30 - Encerramento 16h30. O foco do Centro de Tecnologia da MAHLE \\u00e9 o desenvolvimento de componentes e solu\\u00e7\\u00f5es tecnol\\u00f3gicas para motores de combust\\u00e3o interna, visando \\u00e0 redu\\u00e7\\u00e3o de atrito, de emiss\\u00f5es e do consumo de combust\\u00edvel.\",\"palestrantes\":\"\",\"pic\":\"http:\\/\\/i.imgur.com\\/euV5QcG.png\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"N\\u00e3o \\u00e9 permitido o uso de bermudas, bon\\u00e9s.\\nRecomenda-se o uso de sapato fechado para a circula\\u00e7\\u00e3o no pr\\u00e9dio. \"}}', 12, ''),
(64, 'viagem', '2016-05-11 07:00:00', '2016-05-11 10:30:00', 'Equitron', 'A Equitron é uma empresa que atua na área de automação industrial, produzindo linhas de montagem, células robotizadas e equipamentos especiais para soldagem e testes não destrutivos. Com mais de 30 anos de experiência na área de tecnologia, a Equitron é formada por uma equipe de técnicos, engenheiros e outros profissionais especializados, fornecendo mão de obra de altíssima qualidade e comprometimento.', '{\"location\":\"S\\u00e3o Carlos\",\"desc\":\"A Equitron \\u00e9 uma empresa que atua na \\u00e1rea de automa\\u00e7\\u00e3o industrial, produzindo linhas de montagem, c\\u00e9lulas robotizadas e equipamentos especiais para soldagem e testes n\\u00e3o destrutivos.\",\"palestrantes\":\"\",\"pic\":\"\\/images\\/icons\\/equitron.png\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"Cal\\u00e7ados: T\\u00eanis ou sapatos fechados;\\nRoupas: Cal\\u00e7as compridas\\/Camisas ou camisetas (exceto regatas);\\nN\\u00e3o \\u00e9 permitido filmar ou fotografar durante a visita.\"}}', 12, ''),
(65, 'viagem', '2016-05-11 07:00:00', '2016-05-11 13:00:00', 'Brascabos', 'A Brascabos é empresa fabricante de componentes elétricos e eletrônicos, atuando em diversos setores, inclusive no automotivo. Os produtos e serviços Brascabos compreendem desde a fabricação de fios e cabos, cordões de força, redes elétricas, ignitores cerâmicos, sensores, submontagens, peças plásticas, placas eletrônicas PTH, chicotes especiais para alta temperatura e ambientes corrosivos, porta escovas, até soluções e serviços em logística e engenharia. Desponta como líder no segmento de componentes elétricos para linha branca no Brasil, devido à alta capacidade de agregar ao seu produto todo o serviço de engenharia específico e necessário a cada cliente.', '{\"location\":\"S\\u00e3o Carlos\",\"desc\":\"A Brascabos \\u00e9 empresa fabricante de componentes el\\u00e9tricos e eletr\\u00f4nicos, atuando em diversos setores, inclusive no automotivo.\",\"palestrantes\":\"\",\"pic\":\"http:\\/\\/i.imgur.com\\/pCC69RZ.png\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"Cal\\u00e7ados: T\\u00eanis ou sapatos fechados;\\nRoupas: Cal\\u00e7as compridas \\/Camisas ou camisetas (exceto regatas);\\nSolicita-se n\\u00e3o trazer bolsas, pois n\\u00e3o se disp\\u00f5em de arm\\u00e1rios individuais para guardar pertences de visitantes. Se necess\\u00e1rio, \\u00e9 permitido o uso de pochetes.\"}}', 12, ''),
(66, 'viagem', '2016-05-11 13:00:00', '2016-05-11 18:30:00', 'Casale', 'O parque industrial da Casale foi recentemente remodelado, e teve incorporado novo maquinário de usinagem e conformação de metais de última geração e a aplicação de modernas técnicas de produção, que garantem maior produtividade e mais qualidade ao produto final.\nAs máquinas Casale apresentam nível equivalente às fabricadas em países europeus e da América do Norte, nos quesitos tecnologia, desempenho e qualidade; além disso, são adaptadas às condições de trabalho mais severas, o que explica o sucesso da empresa na exportação de máquinas e tecnologia para diversos países. ', '{\"location\":\"S\\u00e3o Carlos\",\"desc\":\"As m\\u00e1quinas Casale apresentam n\\u00edvel equivalente \\u00e0s fabricadas em pa\\u00edses europeus e da Am\\u00e9rica do Norte, nos quesitos tecnologia, desempenho e qualidade; al\\u00e9m disso, s\\u00e3o adaptadas \\u00e0s condi\\u00e7\\u00f5es de trabalho mais severas, o que explica o sucesso da empresa na exporta\\u00e7\\u00e3o de m\\u00e1quinas e tecnologia para diversos pa\\u00edses.\",\"palestrantes\":\"\",\"pic\":\"http:\\/\\/i.imgur.com\\/0BLE3PI.png\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"Para visitar a produ\\u00e7\\u00e3o \\u00e9 necess\\u00e1rio que todos estejam de cal\\u00e7a cumprida e sapato fechado, sem salto. Os EPI\\u2019s ser\\u00e3o fornecidos pela Casale.\\n\"}}', 12, ''),
(67, 'viagem', '2016-05-11 12:00:00', '2016-05-11 18:30:00', 'Hyundai', 'A Hyundai iniciou oficialmente suas obras no Brasil em 25 de fevereiro de 2011. Ocupando uma área total de 1.390.00m² e 69.000m² construídos, a montadora desenvolve atividades de estamparia, carroceria, pintura e montagem final dos veículos. A capacidade de produção da fábrica é de 150 mil carros por ano, todos dedicados ao mercado nacional.', '{\"location\":\"\",\"desc\":\"Ocupando uma \\u00e1rea total de 1.390.00m\\u00b2 e 69.000m\\u00b2 constru\\u00eddos, a montadora desenvolve atividades de estamparia, carroceria, pintura e montagem final dos ve\\u00edculos. A capacidade de produ\\u00e7\\u00e3o da f\\u00e1brica \\u00e9 de 150 mil carros por ano, todos dedicados ao mercado nacional.\",\"palestrantes\":\"\",\"pic\":\"http:\\/\\/i.imgur.com\\/uSDBgeh.png\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"N\\u00e3o \\u00e9 poss\\u00edvel entrar vestido saias, bermudas, camisa de time, regata, cal\\u00e7ado aberto ou de salto (qualquer tamanho)\\nN\\u00e3o \\u00e9 permitido tirar fotos nas depend\\u00eancias da f\\u00e1brica (interno e externo)\\n\"}}', 12, ''),
(68, 'minicurso', '2016-05-12 08:00:00', '2016-05-12 18:00:00', 'Melhoramento de Processos', 'O melhoramento de processos consiste numa série de ações tomadas para identificar, analisar e melhorar processos de negócios existentes dentro de uma organização de modo a atingir novas metas e objetivos. Estas ações geralmente seguem uma metodologia ou estratégia específicas para criar resultados positivos, tais como Reengenharia de Processos de Negócio, Seis Sigma, Lean Manufacturing, ISO 9000, entre outros. \nSegue abaixo uma descrição dos temas abordados no curso:\n    Questões fundamentais\n        O que é melhoria? O que são processos?\n        O que é melhoria de processos? \n        Quais são os exemplos de processos que temos em nosso dia a dia?\n        Quais são os exemplos de processos nas empresas?\n        Como as empresas melhoram os seus processos?\n    Cases reais\n    Atividade prática\nObservações: ocorrerá o intervalo das 12h às 14h\nNa parte prática, talvez seja necessário sair da sala de aula para uma pesquisa de campo.', '{\"location\":\"Mecatr\\u00f4nica 3\",\"desc\":\"O melhoramento de processos consiste numa s\\u00e9rie de a\\u00e7\\u00f5es tomadas para identificar, analisar e melhorar processos de neg\\u00f3cios existentes dentro de uma organiza\\u00e7\\u00e3o de modo a atingir novas metas e objetivos. Nesse minicurso, ser\\u00e1 mostrado como empresas melhoram seus processos, incluindo an\\u00e1lises de cases reais e uma atividade pr\\u00e1tica.\",\"palestrantes\":\"\",\"pic\":\"http:\\/\\/i.imgur.com\\/lXWq5vJ.png\",\"vagas\":\"0\",\"m\":{\"ch\":\"8h\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 12, ''),
