(153, 'palestra', '2019-05-27 10:45:00', '2019-05-27 12:00:00', 'Tecnologias Emergentes na Indústria 4.0', 'A indústria 4.0 é um pilar da Internet das Coisas e envolve diversas tecnologias. A palestra &amp;amp;quot;Tecnologias Emergentes na Indústria 4.0&amp;amp;quot; inicia com uma breve explicação do conceito de Internet das Coisas e seus exemplos, apresenta os ambientes priorizados pelo governo brasileiro, e principalmente, foca na Indústria 4.0 com destaque na Digital Supply Chain e as tecnologias emergentes que compõe este cenário.', '{\"location\":\"Anfiteatro Jorge Caron\",\"desc\":\"\",\"palestrantes\":\"Renata Rampim\",\"pic\":\"\",\"vagas\":\"\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 15, ''),
(155, 'palestra', '2019-05-31 17:00:00', '2019-05-31 18:00:00', 'Plataforma robótica para ajudar pessoas com deficiência a recuperar sua autonomia', 'Interfaces cérebro-máquina que auxiliem na locomoção e independência de deficientes físicos', '{\"location\":\"Anfiteatro Jorge Caron\",\"desc\":\"\",\"palestrantes\":\"Eric Rohmer\",\"pic\":\"\",\"vagas\":\"\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 15, ''),
(156, 'palestra', '2019-05-28 10:45:00', '2019-05-28 12:00:00', 'Visão Geral sobre a Economia na Área Espacial - “Space Economy”', 'Neste seminário será apresentada uma visão geral do tema “Space Economy”. Durante a Corrida Espacial, os projetos nesse setor foram financiados basicamente pelos governos que se enfrentavam na Guerra Fria. Superado esse período, e com o decorrer dos anos, a dinâmica do setor comercial espacial atingiu maturidade suficiente, para que diversas empresas pudessem se firmar de forma mais consistente no mercado. No cenário internacional, mesmo antes dos anos 2000 já era nítida, tanto a retração dos financiamentos públicos na área espacial, quanto uma maior participação de empresas privadas buscando estabelecer seus negócios. Atualmente o setor espacial internacional movimenta em torno de 330 bilhões de dólares por ano, inclusive possibilitando um considerável volume de negócios de atores que não pertencem à área espacial propriamente dita. A inovação tecnológica desempenha um importante papel para os avanços do setor. Novas propostas de acesso ao espaço vão gerar planos de negócios que atuarão inclusive no turismo espacial. Há uma previsão de que na próxima década deverão ser lançados por volta de 16.000 novos satélites, considerando-se os micro e nano-satélites de interesse de vários países. Enfim, um futuro promissor de negócios no segmento espacial pode ocorrer em diversas áreas.', '{\"location\":\"Anfiteatro Jorge Caron\",\"desc\":\"\",\"palestrantes\":\"Antonio Yukio Ueta\",\"pic\":\"\",\"vagas\":\"\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 15, ''),
(157, 'minicurso', '2019-05-30 08:00:00', '2019-05-30 18:00:00', 'Excel', 'Atualmente, dominar Excel não é mais um diferencial, e sim, pré-requisito para qualquer processo seletivo; além disso, devido à sua versatilidade, esse software é ferramenta básica e extremamente poderosa na montagem de planilhas, gráficos, base, análise de dados e outras diversas tarefas que se possa imaginar.\nAdquirir domínio sobre essa ferramenta exige prática e tempo. Então, pensamos um formato de minicurso que fosse voltado à realização de atividades práticas envolvendo algumas das principais funções do programa, com aplicações em tarefas comuns na atuação acadêmica e corporativa.\n\nActualmente, dominar Excel ya no es un diferencial, sino un requisito previo para cualquier proceso selectivo; Además, debido a su versatilidad, este software es una herramienta básica y extremadamente poderosa en el montaje de hojas de cálculo, gráficos, base, análisis de datos y otras diversas tareas que se pueda imaginar.\nAdquirir dominio sobre esta herramienta requiere práctica y tiempo. Entonces, pensamos un formato de minicurso que se volvía a la realización de actividades prácticas involucrando algunas de las principales funciones del programa, con aplicaciones en tareas comunes en la actuación académica y corporativa.', '{\"location\":\"Pr\\u00e9dio da Mecatr\\u00f4nica - Sala 2\",\"desc\":\"\",\"palestrantes\":\"Guilherme Scagnolatto\",\"pic\":\"\",\"vagas\":\"30\",\"m\":{\"ch\":\"8 horas\",\"alert\":\"Levar computador com Excel instalado\\n\\nLlevar equipo con Excel instalado\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 15, ''),
(158, 'minicurso', '2019-05-30 08:00:00', '2019-05-30 18:00:00', 'Arduino', 'O minicurso tem por finalidade introduzir os participantes ao desenvolvimento de projetos eletrônicos simples com a plataforma Arduino. Por este motivo, serão abordados os seguintes tópicos: Introdução à plataforma de desenvolvimento; conceitos básicos de eletrônica, portas digitais, porta analógicas e comunicação digital. Deste modo, ao término do curso, os participantes poderão continuar o aprendizado e iniciar seus próprios projetos.\n\nEl minicurso tiene por finalidad introducir a los participantes en el desarrollo de proyectos electrónicos simples con la plataforma Arduino. Por este motivo, se abordarán los siguientes temas: Introducción a la plataforma de desarrollo; conceptos básicos de electrónica, puertos digitales, puertos analógicos y comunicación digital. De este modo, al término del curso, los participantes podrán continuar el aprendizaje e iniciar sus propios proyectos.', '{\"location\":\"Pr\\u00e9dio da Mecatr\\u00f4nica - Sala 1\",\"desc\":\"\",\"palestrantes\":\"Leonardo Bonacini\",\"pic\":\"\",\"vagas\":\"16\",\"m\":{\"ch\":\"8 horas\",\"alert\":\"Levar notebook\\n\\nLector de port\\u00e1tiles\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 15, ''),
(159, 'minicurso', '2019-05-30 14:00:00', '2019-05-30 18:00:00', 'Visão Computacional', 'Neste minicurso serão abordados métodos de reconhecimento de imagens com modelos de Redes Neurais Artificiais (RNAs) utilizando o framework do TensorFlow. Também serão aplicadas funções de Processamento de Imagens Digitais (PDI) baseadas no OpenCV. O objetivo principal é desenvolver conhecimento com a fusão de métodos do estado-da-arte para Aprendizado de Máquina, Processamento de Imagens e Visão Computacional, possibilitando desenvolver sistemas inteligentes para manipulação de imagens\n\nEn este minicurso se abordarán métodos de reconocimiento de imágenes con modelos de Redes Neurales Artificiales (ARNs) utilizando el framework de TensorFlow. También se aplicarán funciones de Procesamiento de imágenes digitales (PDI) basadas en OpenCV. El objetivo principal es desarrollar conocimiento con la fusión de métodos del estado de la técnica para Aprendizaje de Máquina, Procesamiento de Imágenes y Visión Computacional, posibilitando desarrollar sistemas inteligentes para manipulación de imágenes', '{\"location\":\"Sala de Micros - Pr\\u00e9dio da Mecatr\\u00f4nica (1 andar)\",\"desc\":\"\",\"palestrantes\":\"Diego Renan Bruno\",\"pic\":\"\",\"vagas\":\"31\",\"m\":{\"ch\":\"4 horas\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 15, ''),
(160, 'viagem', '2019-05-29 07:00:00', '2019-05-29 12:00:00', 'Hyundai', 'A instalação é responsável pela montagem da linha HB20, totalmente desenvolvida e destinada aos consumidores brasileiros, produzindo cerca de 150 mil carros por ano. Essa empresa desenvolve atividades de estamparia, carroceria, pintura e montagem final dos veículos.\n\nEl edificio es responsable por el montaje de la línea de conches HB20,  totalmente desarrollada y destinada a los consumidores brasileños, producciendo cerca de 150 mil coches por año. Esa empresa desarrolla actividades de estamparia, carrocería, pintura y montaje final del vehículo.', '{\"location\":\"Ponto de \\u00d4nibus da Arquitetura\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"Contatar com anteced\\u00eancia a organiza\\u00e7\\u00e3o em caso de defici\\u00eancia ou dificuldade de caminhar.\\nN\\u00e3o \\u00e9 permitido: Saia, bermuda, cal\\u00e7a rasgada, camiseta de time, regata e cal\\u00e7ado aberto\\/salto.\\nN\\u00e3o \\u00e9 permitido tirar foto.\\nLevar documento de identifica\\u00e7\\u00e3o.\\n\\nContactar con antelaci\\u00f3n a la organizaci\\u00f3n en caso de discapacidad o dificultad para caminar.\\nNo se permite: Salga, bermuda, pantal\\u00f3n rasgado, camiseta de equipo, regata y calzado abierto \\/ salto.\\nNo se permite tomar una foto.\\nLlevar documento de identificaci\\u00f3n.\"}}', 15, ''),
(161, 'viagem', '2019-05-29 08:00:00', '2019-05-29 21:30:00', 'IBM', 'Inaugurado em 1977, o prédio compreende as mais importantes organizações de negócios e serviços e é o principal centro gerador de negócios da IBM na América Latina. O participante da XV SEMATRON contará com um tour pelo prédio que é referencia arquitetônica até hoje no mundo, tendo acesso a palestra e coffee break.\n\nInaugurado en 1977, el edificio incuye las más importantes organizaciones de negocios y servicios, siendo el principal centro generador de negocios de la IBM en América Latina. El participante de la SEMATRON podrá hacer una visita por el edificio que es referencia arquitectónica actual en el mundo y tendrá acceso a conferencias e meriendas.', '{\"location\":\"Ponto de \\u00d4nibus da Arquitetura\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 15, ''),
(162, 'viagem', '2019-05-29 07:00:00', '2019-05-29 19:30:00', 'Bovespa', 'Visitas monitoradas gratuitas a todas as pessoas interessadas em conhecer o funcionamento da Bolsa tanto na teoria quanta na prática. Além de agradável, o passeio é muito rico em informações sobre o mercado de ações, de renda fixa e de futuros e proporciona ao visitante uma visão geral sobre o assunto.  A visita inclui as seguintes atrações: Cinema 3D, palestra institucional e explanação do painel de cotações.\n\nVisitas monitoreadas gratuitas a todas las personas interesadas en conocer el funcionamiento de la Bolsa tanto en la teoría cuánta en la práctica. Además de agradable, el paseo es muy rico en informaciones sobre el mercado de acciones, de renta fija y de futuros y proporciona al visitante una visión general sobre el asunto. La visita incluye las siguientes atracciones: Cinema 3D, conferencia institucional y explicación del panel de cotizaciones.', '{\"location\":\"Ponto de \\u00d4nibus da Arquitetura\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 15, ''),
(163, 'viagem', '2019-05-29 07:00:00', '2019-05-29 20:00:00', 'INPE', 'O Instituto Nacional de Pesquisas Espaciais (INPE) localizado em São José dos Campos - SP, é responsável por toda a pesquisa espacial desenvolvida no Brasil. Atualmente, o desenvolvimento de satélites para monitoramento da Amazônia através da parceria com a China, por exemplo,  tem seu projeto e concepção concatenados no INPE.\nO Laboratório Integrado de Testes (LIT) é responsável por testar exaustivamente, nas condições mais adversas, todos os projetos concebidos pelo INPE. O participante da XV SEMATRON terá a oportunidade de visitar as instalações do LIT e ter uma palestra do Diretor do Laboratório a respeito da atual condição da pesquisa espacial brasileira.&amp;amp;amp;amp;amp;quot;\n\nEl Instituto Nacional de Pesquisas Espaciales (INPE), ubicado  en São José dos Campos - SP, es responsable por toda la pesquisa espacial desarrollada en Brasil. Actualmente, el desarrollo de satélites para monitorear la Amazónia tiene su proyecto y concepción ubicado en el INPE y un convenio con China. El Laboratorio Integrado de Testes (LIT) es responsable por testar, en condiciones adversas, todos los proyectos desarrollados  en el INPE. Los participantes de la XV SEMATRON tienen la oportunidad de visitar las instalaciones del LIT y de oír una conferencia del Diretor del Laboratorio  sobre la actual situación de la pesquisa espacial brasileña.', '{\"location\":\"Ponto de \\u00d4nibus da Arquitetura\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"1) usar cal\\u00e7a e sapato fechado\\n2) levar documento original com foto (para imigrantes o passaporte)\\n3) levar dinheiro para comer no almo\\u00e7o e na estrada (opcional)\\n4) recomenda-se levar garrafa de \\u00e1gua\\n\\n1) usar pantalones y zapatos cerrados\\n2) llevar documento original con foto (para inmigrantes el pasaporte)\\n3) llevar dinero para comer en el almuerzo y en la carretera (opcional)\\n4) se recomienda llevar botella de agua\"}}', 15, ''),
(164, 'viagem', '2019-05-29 06:00:00', '2019-05-29 15:30:00', 'Ambev', 'A visita guiada é uma verdadeira experiência cervejeira do início ao fim. Na primeira etapa, os participantes acompanham todo o processo de brassagem, quando o malte e água são misturados. Na sequência, é possível ver os momentos de fermentação e maturação e, no momento da filtração, provar a cerveja segundos depois de pronta, direto do tanque.\n\nLa visita guiada es una verdadera experiencia cervecera de principio a fin. En la primera etapa, los participantes acompañan todo el proceso de brassaje, cuando la malta y el agua se mezclan. En la secuencia, es posible ver los momentos de fermentación y maduración y, en el momento de la filtración, probar la cerveza segundos después de lista, directamente del tanque.', '{\"location\":\"Ponto de \\u00d4nibus da Arquitetura\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"Todos devem estar de cal\\u00e7a comprida, t\\u00eanis e sem adornos. \\n\\nTodos deben estar de pantalones largos, tenis y sin adornos.\"}}', 15, ''),
(165, 'minicurso', '2019-05-30 14:00:00', '2019-05-30 18:00:00', 'Preparando-se para o Mercado de Trabalho', 'Este minicurso tem como objetivo nortear os participantes de como deve ser feita a busca pelo tão sonhado emprego no futuro. Será exposto idéias de o que fazer e o que não fazer em uma entrevista de emprego, bem como estruturar um currículo de forma coerente.\n\nEste minicurso tiene como objetivo orientar a los participantes de cómo debe ser hecha la búsqueda por el tan soñado empleo en el futuro. Se expondrán ideas de qué hacer y qué no hacer en una entrevista de empleo, así como estructurar un currículum de forma coherente.', '{\"location\":\"Anfiteatro Jorge Caron\",\"desc\":\"\",\"palestrantes\":\"Francielle\",\"pic\":\"\",\"vagas\":\"30\",\"m\":{\"ch\":\"4 horas\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 15, ''),
(166, 'minicurso', '2019-05-30 09:00:00', '2019-05-30 11:30:00', 'Latex', 'O LaTeX é o editor de textos científicos mais usado por profissionais do meio acadêmico das áreas de Ciências Exatas. Ele permite, com facilidade e elegância, o uso de fórmulas e equações matemáticas em um texto fornecendo um documento com um excelente layout. Neste minicurso serão apresentados conceitos básicos de como editar e criar textos em LaTeX. \n\nLaTeX es el editor de textos científicos más utilizado por profesionales del medio académico de las áreas de Ciencias Exactas. Permite, con facilidad y elegancia, el uso de fórmulas y ecuaciones matemáticas en un texto proporcionando un documento con un excelente diseño. En este minicurso se presentarán conceptos básicos de cómo editar y crear textos en LaTeX.', '{\"location\":\"Sala de Micros - Pr\\u00e9dio da Mecatr\\u00f4nica (1 andar)\",\"desc\":\"\",\"palestrantes\":\"Prof. Fl\\u00e1vio Marques\",\"pic\":\"\",\"vagas\":\"30\",\"m\":{\"ch\":\"3 horas e 30 minutos\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 15, ''),
(167, 'minicurso', '2019-05-30 08:00:00', '2019-05-30 18:00:00', 'Microcontroladores PIC', 'Esse mini-curso tem como objetivo apresentar as características básicas de hardware e software necessárias para utilizar os microcontroladores PIC em projetos de sistemas embarcados. O curso terá uma parte teórica e uma parte prática, na qual os alunos irão programar um microcontrolador PIC da família 18F utilizando linguagem C para desenvolver pequenos sistemas embarcados. \n\nEste mini-curso tiene como objetivo presentar las características básicas de hardware y software necesarias para utilizar los microcontroladores PIC en proyectos de sistemas embarcados. El curso tendrá una parte teórica y una parte práctica, en la cual los alumnos programar un microcontrolador PIC de la familia 18F utilizando lenguaje C para desarrollar pequeños sistemas embarcados.', '{\"location\":\"Lei-Menor (Pr\\u00e9dio de labs da Eng. El\\u00e9trica)\",\"desc\":\"\",\"palestrantes\":\"Prof. Marcelo Andrade\",\"pic\":\"\",\"vagas\":\"21\",\"m\":{\"ch\":\"8 horas\",\"alert\":\"\\u00c9 desej\\u00e1vel que o estudante possua algum conhecimento em linguagem C para fazer esse mini-curso.\\n\\nEs deseable que el estudiante posea alg\\u00fan conocimiento en lenguaje C para hacer ese mini-curso.\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 15, ''),
(168, 'viagem', '2019-04-09 06:45:00', '2019-05-29 13:00:00', 'Caterpillar', 'A Caterpillar é uma empresa multinacional de origem estadunidense que fabrica máquinas, motores e veículos pesados, voltados principalmente para a construção civil e mineração.\n\nCaterpillar es una empresa multinacional de origen estadounidense que fabrica máquinas, motores y vehículos pesados, orientados principalmente a la construcción y minería.', '{\"location\":\"Ponto de \\u00d4nibus da Arquitetura\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"Todos devem estar de cal\\u00e7a comprida, t\\u00eanis e sem adornos.\\n\\nTodos deben estar de pantalones largos, tenis y sin adornos.\"}}', 15, ''),
(169, 'palestra', '2019-05-28 14:00:00', '2019-05-28 15:15:00', 'Experiências de um unicórnio no mundo das Startups: Da universidade para o mundo', '', '{\"location\":\"Anfiteatro Jorge Caron\",\"desc\":\"\",\"palestrantes\":\"Renato Freitas\",\"pic\":\"\",\"vagas\":\"\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 15, ''),
(171, 'minicurso', '2019-05-30 14:00:00', '2019-05-30 18:00:00', 'Como dominar o medo de falar em público', 'Neste minicurso você irá aprender:\n- Compreender o que gera o medo de falar em público e como atuar nestes fatores para minimizar esta ansiedade.\n- Como se preocupar menos com a opinião de terceiros e ser menos crítico(a) consigo mesmo(a).\n- Como eliminar o branco e outros sinais de ansiedade como velocidade acelerada de fala, vícios de linguagem, apertar de mãos, gagueira, desvio de olhar, voz fraca, entre outros.\n- Os caminhos para se comunicar em essência, em total presença na fala, deixando de lado diálogos internos e condicionamentos passados.\n\nEn este minicurso aprenderás:\n- Comprender lo que genera el miedo a hablar en público y cómo actuar en estos factores para minimizar esta ansiedad.\n- Cómo preocuparse menos con la opinión de terceros y ser menos crítico (a) consigo mismo (a).\n- Cómo eliminar el blanco y otros signos de ansiedad como velocidad acelerada de habla, vicios de lenguaje, apretón de manos, tartamudez, desvío de mirada, voz débil, entre otros.\n- Los caminos para comunicarse en esencia, en total presencia en el habla, dejando de lado diálogos internos y condicionamientos pasados.', '{\"location\":\"Audit\\u00f3rio da Quimica\",\"desc\":\"\",\"palestrantes\":\"Felipe Guedes\",\"pic\":\"\",\"vagas\":\"30\",\"m\":{\"ch\":\"4 horas\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 15, ''),
(172, 'minicurso', '2019-05-30 08:00:00', '2019-05-30 18:00:00', 'Python', 'O objetivo deste curso é introduzir os conceitos básicos de programação para pessoas sem experiência em desenvolvimento ou iniciantes que não conheçam a linguagem Python.\n\nEl objetivo de este curso es introducir los conceptos básicos de programación para personas sin experiencia en desarrollo o principiantes que no conozcan el lenguaje Python.', '{\"location\":\"Lei Maior (Predio de labs da Eng. El\\u00e9trica)\",\"desc\":\"\",\"palestrantes\":\"Grupy Sanca\",\"pic\":\"\",\"vagas\":\"40\",\"m\":{\"ch\":\"8 horas\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 15, ''),
(173, 'palestra', '2019-05-28 09:00:00', '2019-05-28 10:30:00', 'O papel do engenheiro no desenvolvimento e inovação de produtos', 'Vencedor do prêmio de jovem engenheiro concedido pela Bosch em 2017, Thiago graduou-se em engenharia de materiais pela UFSCar e tem MBA em gestão estratégica de negócios pela USP. Seu histórico profissional está relacionado ao desenvolvimento de produtos e atualmente lidera o time de gerenciamento de projetos de novos produtos na Bosch. Nesta palestra ele irá abordar temas relacionados à sua carreira e ao papel do engenheiro no desenvolvimento de novos produtos: pensamento sistêmico com foco no atendimento das necessidades dos consumidores, geração de ideias e inovação, tomada de decisões e gerenciamento de riscos, rotina de trabalho e crescimento profissional.', '{\"location\":\"Anfiteatro Jorge Caron\",\"desc\":\"\",\"palestrantes\":\"Thiago Cabrelon\",\"pic\":\"\",\"vagas\":\"\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 15, ''),
(174, 'viagem', '2019-05-29 07:00:00', '2019-05-29 20:00:00', 'Embraer', '3º maior fabricante de jatos comerciais do mundo, a Embraer é uma empresa brasileira que fabrica aviões comerciais, executivos, militares e agrícolas. Com mais de 18 mil empregados, tem atuação global e busca a excelência empresarial em sua atividade. Em quase 50 anos de empresa foram desenvolvidos e entregues mais de 8 mil aeronaves para clientes de todo o mundo.\n\n3º mayor fabricante de jets comerciales del mundo, Embraer es una empresa brasileña que fabrica aviones comerciales, ejecutivos, militares y agrícolas. Con más de 18 mil empleados, tiene actuación global y busca la excelencia empresarial en su actividad. En casi 50 años de empresa se han desarrollado y entregado más de 8 mil aviones para clientes de todo el mundo.', '{\"location\":\"Ponto de \\u00d4nibus da Arquitetura\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"Almo\\u00e7o ser\\u00e1 realizado em parada na estrada\\n\\u00c9 proibido a entrada de pessoas:\\n- Trajando bermudas, minissaias, sand\\u00e1lias ou chinelos\\n- Menores de 18 anos\\n- Portando filmadoras, m\\u00e1quinas fotogr\\u00e1ficas, gravadores, notebooks, pen drives, cd\'s ou qualquer outro equipamento que possa captar som, imagens ou informa\\u00e7\\u00f5es sobre a empresa\\n\\n\\nEl almuerzo se realizar\\u00e1 en parada en la carretera\\nSe proh\\u00edbe la entrada de personas:\\n- Tramando bermudas, minifaldas, sandalias o zapatillas\\n- Menores de 18 a\\u00f1os\\n- Portando videoc\\u00e1maras, c\\u00e1maras, grabadoras, notebooks, pen drives, cd\'s o cualquier otro equipo que pueda captar sonido, im\\u00e1genes o informaci\\u00f3n sobre la empresa\"}}', 15, ''),
(175, 'minicurso', '2019-05-30 08:00:00', '2019-05-30 18:00:00', 'ROS', 'Neste curso os alunos serão introduzidos a ROS (Robot Operating System). Partiremos de conceitos teóricos básicos, com prática através da linguagem de programação Python ou C++, algumas atividades para reforçar o aprendizado e, por fim, utilização do simulador Gazebo para aplicar os conhecimentos na programação de um robô móvel. \n\nEn este curso los alumnos serán introducidos a ROS (Robot Operating System). Partimos de conceptos teóricos básicos, con práctica a través del lenguaje de programación Python o C ++, algunas actividades para reforzar el aprendizaje y, finalmente, utilizar el simulador Gazebo para aplicar los conocimientos en la programación de un robot móvil.\n', '{\"location\":\"Sala G1 - STI\",\"desc\":\"\",\"palestrantes\":\"Marco Arruda\",\"pic\":\"\",\"vagas\":\"21\",\"m\":{\"ch\":\"8 horas\",\"alert\":\" Requisitos\\n- Familiaridade com Linux\\n- Conhecimento de l\\u00f3gica de programa\\u00e7\\u00e3o\\n\\n- Familiaridad con Linux\\n- Conocimiento de l\\u00f3gica de programaci\\u00f3n\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 15, ''),
(176, 'minicurso', '2019-05-30 14:00:00', '2019-05-30 18:00:00', 'MATLAB', 'Esse mini-curso abordará o básico sobre o ambiente de MatLab, programa de grande utilidade dentro da engenharia. O MatLab é um programa de alto desempenho que permite manipulações matriciais, implementação de algoritmos, plotagem de funções, entre outras atividades.\n\nEsse mini-curso abordará o básico sobre o ambiente de MatLab, programa de grande utilidade dentro da engenharia. O MatLab é um programa de alto desempenho que permite manipulações matriciais, implementação de algoritmos, plotagem de funções, entre outras atividades.', '{\"location\":\"Sala G2 - STI\",\"desc\":\"\",\"palestrantes\":\"Prof. Rodrigo Nicoletti\",\"pic\":\"\",\"vagas\":\"26\",\"m\":{\"ch\":\"4 horas\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 15, ''),
(177, 'palestra', '2019-05-30 20:00:00', '2019-05-30 21:15:00', 'Autonomous Robots – from Design to Navigation and Interaction', 'Nesta palestra, o Prof. Siegwart vai mostrar o desenvolvimento de robôs autônomos aéreos, terrestres e aquáticos em seu laboratório na ETHZ, desde os requisitos de projeto até a sua interação com seres humanos. Maiores informações sobre os projetos podem ser encontradas em: http://www.asl.ethz.ch/research.html', '{\"location\":\"Anfiteatro Jorge Caron\",\"desc\":\"\",\"palestrantes\":\"Roland Siegwart\",\"pic\":\"\",\"vagas\":\"\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 15, ''),
(178, 'palestra', '2019-05-31 14:30:00', '2019-05-31 15:45:00', 'Desafios em Sistemas Embarcados de Aeronaves', 'Visão geral sobre sistemas  de aeronaves e definições. Funcionalidades importantes. Casos de interesse e falhas.  Integração e impacto de novas tecnologias e oportunidades. Desafios futuros.', '{\"location\":\"Anfiteatro Jorge Caron\",\"desc\":\"\",\"palestrantes\":\"Prof. Glauco Caurin e Prof. Jorge Bidinotto\",\"pic\":\"\",\"vagas\":\"\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 15, ''),
(179, 'viagem', '2019-05-29 04:30:00', '2019-05-29 16:00:00', 'Scania 1', 'Scania AB é uma empresa sueca fabricante de caminhões, ônibus, e motores diesel. Com mais de 28.000 funcionários, a Scania possui operações na Europa, América Latina, Ásia, África e Oceania. Sua atuação estende-se por mais de 100 países no mundo. Essa planta trata-se da primeira fábrica de seu gênero, no país, totalmente com soldas a laser e plenamente robotizada.\n\nScania AB es una empresa sueca fabricante de camiones, autobuses, y motores diesel. Con más de 28.000 empleados, Scania tiene operaciones en Europa, América Latina, Asia, África y Oceanía. Su actuación se extiende por más de 100 países en el mundo. Esta planta se trata de la primera fábrica de su género, en el país, totalmente con soldaduras láser y totalmente robotizada.', '{\"location\":\"Ponto de \\u00d4nibus da Arquitetura\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"Obs. Haver\\u00e1 2 viagens para a Scania, ambas ser\\u00e3o iguais por\\u00e9m em hor\\u00e1rios diferentes\\n\\nObs. Habr\\u00e1 2 viajes para Scania, ambas ser\\u00e1n iguales pero en horarios diferentes\"}}', 15, ''),
(180, 'viagem', '2019-05-29 09:00:00', '2019-05-29 21:00:00', 'Scania 2', 'Scania AB é uma empresa sueca fabricante de caminhões, ônibus, e motores diesel. Com mais de 28.000 funcionários, a Scania possui operações na Europa, América Latina, Ásia, África e Oceania. Sua atuação estende-se por mais de 100 países no mundo. Essa planta trata-se da primeira fábrica de seu gênero, no país, totalmente com soldas a laser e plenamente robotizada.\n\nScania AB es una empresa sueca fabricante de camiones, autobuses, y motores diesel. Con más de 28.000 empleados, Scania tiene operaciones en Europa, América Latina, Asia, África y Oceanía. Su actuación se extiende por más de 100 países en el mundo. Esta planta se trata de la primera fábrica de su género, en el país, totalmente con soldaduras láser y totalmente robotizada.', '{\"location\":\"Ponto de \\u00d4nibus da Arquitetura\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"Obs. Haver\\u00e1 2 viagens para a Scania, ambas ser\\u00e3o iguais por\\u00e9m em hor\\u00e1rios diferentes\\n\\nObs. Habr\\u00e1 2 viajes para Scania, ambas ser\\u00e1n iguales pero en horarios diferentes\"}}', 15, ''),
(181, 'viagem', '2019-05-29 07:30:00', '2019-05-29 10:00:00', 'Electrolux', 'Líder mundial em eletrodomésticos e aparelhos de uso profissional, a Electrolux está presente em mais de 150 países, empregando mais de 54 mil funcionários. Trajetória de quase 100 anos de existência traduzida em desenvolvimento, inovação, design moderno e funcionalidade. Durante a visita,  os participantes conhecerão mais da história da Electrolux, terão a oportunidade de conversar com engenheiros elétricos e mecânicos, conhecer a unidade fabril, as áreas de automação, ter um um coffee break e por fim um showroom. \n\nLíder mundial en electrodomésticos y aparatos de uso profesional, Electrolux está presente en más de 150 países, empleando a más de 54 mil empleados. Trayectoria de casi 100 años de existencia traducida en desarrollo, innovación, diseño moderno y funcionalidad. Durante la visita, los participantes conocerán más de la historia de Electrolux, tendrán la oportunidad de conversar con ingenieros eléctricos y mecánicos, conocer la unidad fabril, las áreas de automatización, tener un café break y por fin un showroom.', '{\"location\":\"Ponto de \\u00d4nibus da Arquitetura\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"0\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"Levar documento de identifica\\u00e7\\u00e3o com foto. Usar cal\\u00e7a e cal\\u00e7ado fechado, sapatilhas n\\u00e3o ser\\u00e3o permitidas.\"}}', 15, ''),
(182, 'minicurso', '2019-05-30 14:00:00', '2019-05-30 18:00:00', 'Automação Residencial (Bluetooth e Android)', 'A oficina de automação residencial terá duas etapas: a primeira visa apresentar conceitos básicos sobre projetos de automação residencial, dando ao participante uma base teórica do que é automação residencial e exemplos de produtos e projetos do tema; a segunda etapa será puramente &amp;amp;amp;amp;amp;amp;quot;hands-on&amp;amp;amp;amp;amp;amp;quot; (mão na massa) em que todos os participantes terão contato com Arduinos e componentes para criarem seus projetos de automação residencial. Para isso serão apresentados comandos básicos de Arduino, bibliotecas comumente usadas para projetos de automação e aplicativos em Android para a comunicação com estes sistemas. Ao fim da oficina o participante terá base para criar seus próprios projetos de automação residencial utilizando equipamentos de baixo custo.\n\nEl taller de automatización residencial tendrá dos etapas: la primera pretende presentar conceptos básicos sobre proyectos de automatización residencial, dando al participante una base teórica de lo que es automatización residencial y ejemplos de productos y proyectos del tema; el segundo paso será puramente &amp;amp;amp;amp;amp; quot; manos-on &amp;amp;amp;amp;amp; quot; (mano en la masa) en la que todos los participantes tendrán contacto con Arduinos y componentes para crear sus proyectos de automatización residencial. Para ello se presentarán comandos básicos de Arduino, bibliotecas comúnmente usadas para proyectos de automatización y aplicaciones en Android para la comunicación con estos sistemas. Al final del taller el participante tendrá base para crear sus propios proyectos de automatización residencial utilizando equipos de bajo costo.', '{\"location\":\"Biblioteca da EESC\",\"desc\":\"\",\"palestrantes\":\"Guilherme Bileki\",\"pic\":\"\",\"vagas\":\"14\",\"m\":{\"ch\":\"4 horas\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 15, ''),
(183, 'minicurso', '2019-05-30 08:00:56', '2019-05-30 18:00:05', 'KUKA', 'Aprenda a programar e utilizar os braços robóticos KUKA, usados em larga escala em linhas de produção industrial nesse minicurso introdutório de 8 horas, dividido em prática e teórica.\n\nAprenda a programar y utilizar los brazos robóticos KUKA, usados a gran escala en líneas de producción industrial en ese minicurso introductorio de 8 horas, dividido en práctica y teórica.', '{\"location\":\"Pr\\u00e9dio da Mecatr\\u00f4nica - 1\\u00ba Andar, KUKA\",\"desc\":\"\",\"palestrantes\":\"Gustavo Lar\",\"pic\":\"\",\"vagas\":\"10\",\"m\":{\"ch\":\"8 horas\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 15, ''),
