(189, 'palestra', '2020-11-20 14:00:00', '2020-11-20 15:00:00', 'Estratégias para Empreender', 'Nesta palestra, Raphael Fassoni  passará estratégias para começar a empreender, abordando qual é o perfil do empreendedor, como montar uma base de conhecimento antes de empreender e como está sendo empreender na Europa. Também abordará a transformação digital no Brasil e na Estônia.', '{\"location\":\"\",\"desc\":\"\",\"palestrantes\":\"\",\"pic\":\"\",\"vagas\":\"1000\",\"m\":{\"ch\":\"\",\"alert\":\"\",\"cont\":\"\"},\"v\":{\"alert\":\"\"}}', 16, ''),
